<template>
  <div class="flex flex-col h-full bg-gray-50">
    <header class="p-4 bg-white border-b shadow-sm">
      <h3 class="text-lg font-semibold">{{ recipientName }}</h3>
    </header>

    <div ref="messagesContainer" class="flex-grow p-4 overflow-y-auto space-y-4">
      <div v-for="message in messages" :key="message.id" class="flex" :class="message.isMine ? 'justify-end' : 'justify-start'">
        <div 
          class="max-w-xs lg:max-w-md px-4 py-2 rounded-xl"
          :class="message.isMine 
            ? 'bg-indigo-600 text-white rounded-br-none' 
            : 'bg-white text-gray-800 border rounded-tl-none'"
        >
          <p v-html="formatMessage(message.content)"></p> 

          <div v-if="message.image_url" class="mt-2">
            <a :href="message.image_url" target="_blank">
              <img :src="message.image_url" alt="Imagen adjunta" class="rounded-lg max-h-40 cursor-pointer">
            </a>
          </div>

          <span class="block text-xs mt-1" :class="message.isMine ? 'text-indigo-200' : 'text-gray-500'">
            {{ formatTime(message.created_at) }}
          </span>
        </div>
      </div>
    </div>

    <footer class="p-4 bg-white border-t">
      <form @submit.prevent="sendMessage" class="flex items-center space-x-3">
        
